import React from 'react';
import './css/HeroHeader.css';
import heroHeaderImage from './../images/heroHeaderImage.jpg';

function HeroHeader() {
    return (
        <div className="hero-image">
            <img src={heroHeaderImage} className="hero-image" alt="Hero Image" />
            <div className="hero-text">
                <h1>David Mah</h1>
                <p>Software Engineer</p>
            </div>
        </div> 
    )
}

export default HeroHeader;
